function maxValue(e,t,n,r,i){t++;var s=hasWinner(e);if(s!=null)return s==i?Number.POSITIVE_INFINITY-1:Number.NEGATIVE_INFINITY+1;if(t>MAX_ITERATION)return utility(e,i);var o=Number.NEGATIVE_INFINITY,u=getPossibleMovements(e,i);if(u.length==0)return Number.POSITIVE_INFINITY-1;for(var a=0;a<u.length;a++){o=Math.max(o,minValue(u[a].table,t,n,r,i));if(o>=r)return o;n=Math.max(n,o)}return o}function minValue(e,t,n,r,i){t++;var s=hasWinner(e);if(s!=null)return s==i?Number.POSITIVE_INFINITY-1:Number.NEGATIVE_INFINITY+1;if(t>MAX_ITERATION)return utility(e,i);var o=Number.POSITIVE_INFINITY,u=getPossibleMovements(e,i);if(u.length==0)return Number.POSITIVE_INFINITY-1;for(var a=0;a<u.length;a++){o=Math.min(o,maxValue(u[a].table,t,n,r,i));if(o<=n)return o;r=Math.min(r,o)}return o}function minimaxDecision(e,t){var n=getPossibleMovements(e,t),r=Number.NEGATIVE_INFINITY,i=null;for(var s=0;s<n.length;s++){var o=minValue(n[s].table,0,Number.NEGATIVE_INFINITY,Number.POSITIVE_INFINITY,t);if(o>r){r=o;i=s}}return n[i]}function utility(e,t){return utilityGreedy(e,t)}function utilityGreedy(e,t){var n=0,r=0;for(var i=0;i<e.length;i++)for(var s=0;s<e[0].length;s++)if(e[i][s]==t||e[i][s]==t+LADY_ADD_VALUE||e[i][s]==t-LADY_ADD_VALUE){e[i][s]>1&&(r+=10);r++}else if(e[i][s]!=EMPTY_CELL){e[i][s]>1&&(n+=4);n++}return-n}function utilityBalanced(e,t){var n=0,r=0;for(var i=0;i<e.length;i++)for(var s=0;s<e[0].length;s++)if(e[i][s]==t||e[i][s]==t+LADY_ADD_VALUE||e[i][s]==t-LADY_ADD_VALUE){e[i][s]>1&&(r+=10);r++}else if(e[i][s]!=EMPTY_CELL){e[i][s]>1&&(n+=4);n++}return r-n};